  <p style="font-family: Arial, Verdana, sans-serif; font-size: 12px; text-align: justify;"><span style="color: #333333; font-family: Arial; text-align: left;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">История этой немецкой часовой компании начинается с далекого 1926 года. Изначально, она специализировалась на производства карманных часов, которые считались одними из самых лучших. Компании Tutima принадлежат несколько технических разработок, которые, в то время, считались инновационными. Благодаря этой компании, немецкая часовая промышленность шла наравне со знаменитыми швейцарскими производителями. Во время Второй Мировой войны, Tutima производила специальные хронографы для немецких воздушных сил, которые пользовались неизменной популярностью. Есть одна интересная особенность: после того, как война закончилась, советскими солдатами было вывезено оборудование, которое принадлежало компании Tutima. Благодаря этому оборудованию, советская промышленность подарила своим гражданам новые хронографы, которые назывались «Кировские». Но, несмотря на свое высокое качество, они не были распространены по всему СССР. На данный момент, компания Tutima производит hi-tech часы, которые соединяют традиции немецкого часового производства и современные черты. Эти часы проходят самую экстремальную проверку, благодаря которой весь некачественный товар имеет возможность доработки. В ассортименте компании Tutima присутствует пять линеек, в каждой из которых есть различные модели. Среди них встречаются и золотые, и серебряные, и стальные часы, которые отличаются своим высочайшим качеством.</span></span></span></p>
 
